const styles = {
li: {
    listStyleType: 'none',
    marginLeft: '-1vw',
    fontSize: '1.5rem',
    fontWeight: '600'
  }
}

const Title = props => {

}

const ListItem = props => {
  return (
      <li style={styles.li}>
        <FontAwesomeIcon icon="arrow-right" />
        &ensp; {props.children}
      </li>
  );
};

export {ListItem, Title};
